import React from "react";
import { Link } from "react-router-dom";
import "../styles/Header.css";

const Header = () => {
  return (
    <header className="header">
      <div className="logo">
        <h1>نمایش بصری هش</h1>
        <p>MD5, SHA-1, SHA-256 | طراحی شده توسط یاسین کیانی</p>
      </div>
      <nav className="nav">
        <ul>
          <li>
            <Link to="/">صفحه اصلی</Link>
          </li>
          <li>
            <Link to="/hash-generator">ساخت هش</Link>
          </li>
          <li>
            <Link to="/visual-hash">هش بصری</Link>
          </li>
          <li>
            <Link to="/password-cracker">شکستن رمز عبور</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
